import React from 'react';
function NewsArticle({ data }) {
    return(
    <div className="news">
        <a href ={data.urlToImage}><span className="news__image"> {data.urlToImage}</span> </a> <br />
        <h3 className="news__title">{data.title}</h3>
        <p className="news__desc">{data.description}</p>
        <span className="news__author">Author: {data.author}</span> <br />
        <span className="news__published">Date Pub: { data.publishedAt}</span> <br />
        <span className="news__source">Source: {data.source.name}</span> <br />
        <a href ={data.url}><span className="news__url"> URL:  {data.url} </span></a>
    </div>
  );
}

export default NewsArticle;
